import React, { useState } from 'react'
import LoginButton from './components/LoginButton'
import LogoutButton from './components/LogoutButton'
import { useAuth0 } from '@auth0/auth0-react'
import { Listbox } from '@headlessui/react'

export default function App() {
  const {user} = useAuth0();
  const [organization, setOrganization] = useState();
  const [email, setEmail] = useState();
  const [organizations, setOrganizations] = useState();

  const getOrgs = () => {
    fetch('http://localhost:8080/user-orgs-by-email?email=' + 'sam@sam.com')
    .then(response => response.json())
    .then(data => setOrganizations(data));

    console.log('organizations',organizations);
    setTimeout(() =>  setOrganization(organizations[0], 300));
  }

  return (
    <div style={{width:"200px", margin:"0 auto"}}>
      <h1>Team 0</h1>
      {!user && 
        <>
          <button onClick={() => getOrgs()}>Test</button>
          <LoginButton organization={organization} email={email}/>
        </>
      }
      {organizations && organization &&
        <>
          <Listbox value={organization} onChange={setOrganization}>
            <Listbox.Button>{organization.display_name}</Listbox.Button>
            <Listbox.Options>
              {organizations.map((org) => (
                <Listbox.Option
                  key={org.id}
                  value={org}
                >
                  {org.display_name}
                </Listbox.Option>
              ))}
            </Listbox.Options>
          </Listbox>
        </>
      }
      {user &&
        <>
          <LogoutButton />
          <thead>
            <tr>
              <th>First Name</th>
              <th>Email</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{user.nickname}</td>
              <td>{user.email}</td>
            </tr>
          </tbody>
        </>
      }
    </div>
  )
}
